            <ul className="myList" {...provided.droppableProps}>
                {array.map(({id, title, thumb}, index) => {
                    return (

                                <li key={id}>
                                    {index+1 +". "}
                                    { title }

                                </li>

                    );
                })}
            </ul>
  )
}

